import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";


function Note(props) {
  function handleClick() {
    props.onDelete(props.id);
  }

  return (
    //<div className="note" >
    <div className="note" style={{backgroundColor: (new Date()).diff(moment(props.date))<1 ? 'red' : '#eee', }}>
      <h5>{props.date}</h5>
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button onClick={handleClick}>
        <DeleteIcon />
      </button>
    </div>
  );
}

export default Note;
